import './index.css'
import {Component} from 'react'

class LettersCalculator extends Component {
  render() {
    return (
      <div>
        <img />
        <div>
          <h1>Calculate the Letters you enter</h1>
          <p>Enter the phrase</p>
          <input type="search" placeholder="Enter the Phrase" />
        </div>
      </div>
    )
  }
}
